import React from 'react';
import Sidebar from './components/Sidebar';
import Content from './components/Content';
import './styles/App.css';

const App = () => {
  return (
    <div className="app-container">
      <Sidebar />
      <div className="main-content">
        <Content />
      </div>
    </div>
  );
};

export default App;
